Don’t quit your daydream // Still pinching myself, totally taken aback with thankfulness that we had the opportunity to heli in AK this spring. Accessing these mountains by bird has been one of the many dreams of mine since my initial brush with the supernatural power of the Alaska Range in 2016. That first trip we were sledding, shredding, and camping on Haines Pass. That expedition was the hitch into the heart, what has guided the trajectory of my life for almost 10 years—signing up to be student of riding lines. Looking back now, I can see without a doubt, that all of those years that I yearned to heli access up there, I wasn’t ready to fully step up and step into that terrain. This year, it felt right. 

I’m proud of myself for sticking with the request of the heart to come back and fly. It’s been a wild ride to get here; lifestyle sacrifices, battles with doubt and learning to trust, but it was worth it. Don’t quit your daydream; trust that the universe has always got your back when you listen to the whispers of heart. 

